import React from "react";
import Grid from "@material-ui/core/Grid";
import { GoogleLoginButton } from "react-social-login-buttons";
import './index.css'

const GoogleButton = () => {
    return (
        <Grid item style = {{width : "100%"}}>
            <GoogleLoginButton/>
        </Grid>
    );
}

export default GoogleButton;
